import React from 'react';
import Card from '../Card/Card';
import "./CardList.scss"


const CardList = (props) => {

    const { data } = props

    return (
        <main>
            <ul className='card-list'>
                {data.map((el) => <Card key={el.article} card={el} />)}
            </ul>
        </main>
    )
}

export default CardList
